  return (
    <div className="App">
      <Header />
      <Router> 
      <header className="App-header">



        <Switch>

          <Route path= "/message">
          </Route>
          {/* homepage route always at the bottom */}
          <Route path= "/">
            <Cards />
            <MatchBtns />
          </Route>
        </Switch>




        </header>

        </Router>
    </div>
  );
}

export default App;
